import React from "react";
import Hello from "./components/Hello";
import Container from "./components/Container";
import Row from "./components/Row";
import ImageCard from "./components/ImageCard";

const App = () => {

  return (
    <Container>
        <Row>
            <div className="jumbotron">
                <Hello />
            </div>
        </Row>
    </Container>
  );
}

export default App;
